import React, { useState } from 'react'

import { Formik, Form, FieldArray } from 'formik'

import PropTypes from 'prop-types'
import { Box, Tabs, Tab, Typography, FormControl, FormLabel, Select, MenuItem, TextField, FormGroup, FormControlLabel, Checkbox } from '@mui/material'

import maximumStayDuration from '../../Json/MaximumStayDuration'
import statusAtPointOfRegestering from '../../Json/StatusAtPointOfRegestering'
import serviceCostTerm from '../../Json/ServiceCostTerm'
import livingPlaceFacilities from '../../Json/livingPlaceFacilities'

import 'bootstrap/dist/css/bootstrap.css'
import Carousel from 'react-bootstrap/Carousel'

const livingPlace = {
    'max_stay_duration': '',
    'rental_price_term': '',
    'description': '',
    'changeover_time': '',
    'deposit': '',
    'service_costs': '',
    'rentalprice': 10,
    'b2b_price': 100.0,
    'b2c_price': 130.0,
    'vhe_facility': {
    'Welcome pack': true,
    'Bed sheets': false,
    'Towels': false,
    'Bike': false,
    'Weekly cleaning': false,
    'Final cleaning': false,
    'Kitchen supplies': false,
    'WI-FI': false,
    'WI-FI and television': false
    }
}

const room = {
    room_type: '',
    room_number: '',
    floor: '',
    dimension_m2: '',
    coliving_allowed: '',
    number_of_living_places: '',
    room_facility_type:  {
        wardrobe: '',
        sink: '',
        working_space: '',
        fridge: '',
        built_in_wardrobe: ''
    },
    vhes: []
}

function TabPanel(props) {

    const { children, value, index, ...other } = props

    return (
        <div
            role='tabpanel'
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box sx={{ p: 3 }}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    )
}

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
}

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    }
}

const LivingPlaceInformations = (props) => {

    let initialValues = {
        rooms: ''
    }

    initialValues.rooms = props.data.rooms
